    Main(String s)
    {
        StringTokenizer t=new StringTokenizer(s,"+-");
        String sign[]=getsign(s,t.countTokens());
        terms tt[]=new terms[t.countTokens()];
        System.out.println(t.countTokens());
        int i=0;
        while(t.hasMoreTokens())
        {
            int coeff,pow;
            String temp=t.nextToken();
            if(temp.contains("x"))
            {
                int k=0;
                char ppp=' ';
                String ttt="";
                while(ppp!='x')
                {
                    ppp=temp.charAt(k);
                    ttt+=ppp;
                    k++;
                }
                coeff=Integer.parseInt(ttt.replace("x",""));
                if(temp.contains("^"))
                {
                    int k1=temp.indexOf("^");
                    String tempp="";
                    for(int p1=k1+1;p1<temp.length();p1++)
                    {
                        tempp+=temp.charAt(p1);
                    }
                    pow=Integer.parseInt(tempp);
                }
                else
                {
                    pow=1;
                }
                tt[i]=new terms();
                tt[i].setvalue(coeff, pow);
                i++;
            }
            else
            {
                tt[i]=new terms();
                tt[i].setvalue(0,0);
            }
        }
        tt=deri(tt);
        String result="";
        for(int j=0;j<tt.length;j++)
        {
            int coeff=tt[j].getcoeff();
            int pow=tt[j].getpow();
            if(coeff==0)
            {
                result+=""+sign[j];
            }
            else
            if(pow==1)
            {
                result+=coeff+"x"+sign[j];
            }
            else
            if(pow==0)
            {
                result+=coeff+sign[j];
            }
            else
            {
                result+=coeff+"x^"+pow+sign[j];
            }
        }
        if(result.endsWith("null"))
        {
            result=result.replaceAll("null","");
        }
        if((result.endsWith("+"))||(result.endsWith("-")))
        {
            result=result.substring(0,result.length()-1);
        }
        System.out.println(result);
    }

    public String[] getsign(String s,int len)
    {
        String p[]=new String[len];
        int j=0;
        for(int i=0;i<s.length();i++)
        {
            if((s.charAt(i)=='+')||(s.charAt(i)=='-'))
            {
                p[j]=""+s.charAt(i);
                j++;
            }
        }
        return p;
    }

    public terms[] deri(terms tt[])
    {
        for(int j=0;j<tt.length;j++)
        {
            int coeff=tt[j].getcoeff();
            int pow=tt[j].getpow();
            if(coeff==0)
            {
                tt[j].setvalue(0, 0);
            }
            else
            if(pow==1)
            {
                tt[j].setvalue(coeff,0);
            }
            else
            {
                int p=coeff*pow;
                int pp=pow-1;
                tt[j].setvalue(p,pp);
            }
        }
        return tt;
    }
